// AgendamentosPage.tsx
import React, { useEffect, useState } from 'react';
import { useAuth } from '../Context/useAuth'; // Importando o contexto para obter o token
import { getAgendamentosAPI } from '../api/AgendamentoAPI'; // Importando o serviço

const AgendamentosPage = () => {
    const { token } = useAuth(); // Obtendo o token do contexto
    const userId = 9; // Substitua isso pelo ID do usuário apropriado
    const [agendamentos, setAgendamentos] = useState<any[]>([]); // Estado para armazenar os agendamentos
    const [error, setError] = useState<string | null>(null); // Estado para armazenar erros

    useEffect(() => {
        const fetchAgendamentos = async () => {
            if (!token) return; // Se não houver token, não faz a requisição
            try {
                const data = await getAgendamentosAPI(token, userId);
                setAgendamentos(data);
            } catch (error) {
                setError('Erro ao buscar os agendamentos');
            }
        };

        if (token) { // Apenas buscar se o token estiver presente
            fetchAgendamentos(); // Chamando a função de busca
        }
    }, [token]); // Executa o efeito quando o token muda

    return (
        <div className="agendamentos-page">
            <h1>Meus Agendamentos</h1>
            {error && <p className="error-message">{error}</p>}
            {agendamentos.length === 0 ? (
                <p>Nenhum agendamento encontrado.</p>
            ) : (
                <ul className="agendamentos-list">
                    {agendamentos.map((agendamento) => (
                        <li key={agendamento.id} className="agendamento-item">
                            <h2>Agendamento ID: {agendamento.id}</h2>
                            <p><strong>Data:</strong> {new Date(agendamento.dataAgendamento).toLocaleDateString()}</p>
                            <p><strong>Hora:</strong> {agendamento.horaAgendamento}</p>
                            <p><strong>Status:</strong> {agendamento.status}</p>
                            <p><strong>Observações:</strong> {agendamento.observacoes}</p>
                            <h3>Serviço:</h3>
                            <p><strong>Categoria:</strong> {agendamento.servicoCategoria.nome}</p>
                            <p><strong>Subcategoria:</strong> {agendamento.servicoSubCategoria.nome}</p>
                            <p><strong>Duração:</strong> {agendamento.servicoSubCategoria.duracao}</p>
                            <p><strong>Valor:</strong> R${agendamento.servicoSubCategoria.valor.toFixed(2)}</p>
                            <h3>Profissional:</h3>
                            <p><strong>Nome:</strong> {agendamento.profissional.nome}</p>
                            <p><strong>Email:</strong> {agendamento.profissional.email}</p>
                            <p><strong>Telefone:</strong> {agendamento.profissional.telefone}</p>
                            <hr />
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
};

export default AgendamentosPage;
